/**
 * @param {string} s
 * @param {number} k
 * @return {number}
 */
var minimumChanges = function(s, k) {
    const n = s.length;
    const dp = Array.from(Array(n + 1), () => Array(k + 1).fill(Infinity));
    const changesToSemiPalindrome = (start, end) => {
        let changes = 0, mid = Math.floor((start + end) / 2);
        for (let i = start; i <= mid; i++) {
            if (s[i] !== s[end - (i - start)]) changes++;
        }
        return changes;
    };

    dp[0][0] = 0;
    for (let i = 1; i <= n; i++) {
        for (let j = 1; j <= Math.min(i, k); j++) {
            if (j == 1) {
                dp[i][j] = changesToSemiPalindrome(0, i - 1);
            } else {
                for (let m = j - 1; m < i; m++) {
                    dp[i][j] = Math.min(dp[i][j], dp[m][j - 1] + changesToSemiPalindrome(m, i - 1));
                }
            }
        }
    }

    return dp[n][k];
};
